import "./App.css";
import { Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <div className="App">
      <>
        <div className="container" style="background-color:powderblue;">
          <div className="row">
            <div></div>
          </div>
        </div>
      </>
    </div>
  );
}

export default App;
